import './App.css'
import React from 'react'
import {AnimatePresence} from 'framer-motion'
import {
  BrowserRouter,
  Routes,
  Route,
  useLocation
} from 'react-router-dom'
import AnimatedRoutes from './compontents/AnimatedRoutes.js'

function App() {
  return (
    <div className="App">
      <header>
      <AnimatePresence mode='wait'>
        <BrowserRouter>
          <AnimatedRoutes />
        </BrowserRouter>
        </AnimatePresence>
      </header>
    </div>
  );
}

export default App;
